            // console.log(json)
            // if(response.ok){
            //     setWorkouts(json);
            // }
        };

        fetchWorkout();
    },[]);
    
    return(
        <div className='home'>
            <div className="workout">
                {workouts && workouts.map((workout)=>(
                    <p key={workout._id}>
                        {workout.title}
                    </p>
                ))}
            </div>
        </div>
    )
};

export default Home;
